import React from 'react';
import { HiOutlineMenuAlt1 } from "react-icons/hi";

const toolbar = props => (
    <>
        <div className="col-lg-5 col-md-4 col-6 ">
        <a href="#" className="push-menu-btn">
            <HiOutlineMenuAlt1 />
        </a>
    </div>
        <div className="toolbar_navigation-item">
            <ul>
                <li><a href="/">Home</a></li>
                <li><a href="/">Home</a></li>
            </ul>
        </div>
    </>
);

export default toolbar;
